import { axios } from "./axios";

export async function sendMessage(param : any)  {
    try {
        const res = await axios.post("", param);
        console.log(res);
    }catch ( err ){
        console.log(err)
    }
    /*await Axios.post(baseUrl, data, {
        validateStatus: () =>  false,
